import React from "react";



const TrendItem = (props) => {
    return (
        <>
            <tr>
                <th scope="row">{props.tid}</th>
                <td>{props.fName}</td>
                <td>{props.lName}}</td>
                <td>{props.hashtagi}}</td>
            </tr>
        </>

    );
}

export {TrendItem};
